import Table from './Table';
import Title from './Title';
import { BrowserRouter, Route, Routes } from "react-router-dom";
import MarkModal from './MarkModal';
import Mark from './Mark';
import React from 'react';

function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <Title />
        <Routes>
        <Route exact path="/">
          <React.Fragment>
            <Table />
          </React.Fragment>
        </Route>
          <Route path="/Mark/:id">
            <Mark />
          </Route>
          <Route path="/Modal">
            <MarkModal />
          </Route>
        </Routes>
      </div>
    </BrowserRouter>
  );
}

export default App;
